INSERT INTO `t_cms_content` VALUES (180,1,1,181,79,'这是一片日记','这是一片日记','这是一片日记这是一片日记这是一片日记这是一片日记',0,0,'',1,'2017-07-23 13:28:29','2017-07-23 13:28:29','','admin',50),(181,1,1,181,79,'PHP 7.2.0 Beta 1 发布，7.2.0 首个测试版','PHP','PHP 7.2.0 Beta 1 发布，7.2.0 首个测试版',0,0,'',1,'2017-08-02 17:38:36','2017-08-02 17:38:36','','admin',36),(182,1,1,183,79,'使用redis和zookeeper实现分布式锁','redis,zookeeper','分布式锁一般用在分布式系统或者多个应用中，用来控制同一任务是否执行或者任务的执行顺序。在项目中，部署了多个tomcat应用，在执行定时任务时就会遇到同一任务可能执行多次的情况，我们可以借助分布式锁，保证在同一时间只有一个tomcat应用执行了定时任务。',0,0,'http://cdn.chinafirefans.com/f5820faf29b2430fb7980f0a85132e34.jpg?imageslim',1,'2017-07-23 16:29:35','2017-07-23 16:29:34','','admin',33),(183,1,1,181,79,'123132','12313','12313212313213212',0,0,'',1,'2017-09-15 14:33:10','2017-09-15 14:33:10','','admin',8),(184,1,1,181,79,'12312312','123123','123123132123123',0,1,'',1,'2017-09-26 11:38:23','2017-09-26 11:38:23','','admin',0);

