INSERT INTO `t_cms_content_news` VALUES (180,'<p>这是一片日记</p><p>这是一片日记</p><p>这是一片日记</p><p>这是一片日记</p><p><br></p>'),(181,'<p><font size=\"4\" face=\"宋体\">PHP开发团队宣布&nbsp;PHP 7.2.0 Beta 1 发布了。这是7.2.0的第一个测试版。</font></p><p><font size=\"4\" face=\"宋体\">该版本在原来版本的基础上进行了一下更新：</font></p><ul><li><font size=\"4\" face=\"宋体\">The much anticipated Sodium extension</font></li><li><font size=\"4\" face=\"宋体\">Opcache improvements</font></li><li><font size=\"4\" face=\"宋体\">Countable support for DOMNodeList and DOMNamedNodeMap</font></li><li><font size=\"4\" face=\"宋体\">Improved handling for invalid UTF8 in json_decode()</font></li><li><font size=\"4\" face=\"宋体\">And many bugfixes...</font></li></ul><p><font size=\"4\" face=\"宋体\">完整内容请查看<a href=\"http://php.net/archive/2017.php#id2017-07-20-1\" target=\"_blank\">发行说明</a>。</font></p><p><font size=\"4\" face=\"宋体\">下载地址：</font></p><ul><li><font size=\"4\" face=\"宋体\"><a href=\"https://downloads.php.net/%7Epollita/\">https://downloads.php.net/~pollita/</a></font></li></ul><p><font size=\"4\" face=\"宋体\">&gt;&gt;&gt;【评论有礼】7月10日-31日在下方评论资讯，即有机会获得 9 活跃积分和开源中国实物周边。<a href=\"https://www.oschina.net/news/86618/oschina-7yue-kaiyuanreping\" target=\"_blank\">活动详情</a></font></p><p><br></p>'),(182,'<h2>1.分布式锁</h2><p>分布式锁一般用在分布式系统或者多个应用中，用来控制同一任务是否执行或者任务的执行顺序。在项目中，部署了多个tomcat应用，在执行定时任务时就会遇到同一任务可能执行多次的情况，我们可以借助分布式锁，保证在同一时间只有一个tomcat应用执行了定时任务。</p><h2>2.分布式锁的实现方式</h2><ol><li>使用redis的setnx()和expire()</li><li>使用redis的getset()</li><li>使用zookeeper的创建节点node</li><li>使用zookeeper的创建临时序列节点</li></ol><h2>3.使用redis的setnx()和expire()来实现分布式锁</h2><pre><code>setnx(key,<span><span><span><span>value</span></span></span></span>) 如果key不存在，设置为当前key的值为<span><span><span><span>value</span></span></span></span>;如果key存在，直接返回。\r\nexpire()来设置超时时间\r\n</code></pre><p>定义注解类：</p><pre><code><span><span><span><span>@Target</span></span></span></span>({ElementType.METHOD})\r\n<span><span><span><span>@Retention</span></span></span></span>(RetentionPolicy.RUNTIME)\r\npublic <span><span><span><span>@interface</span></span></span></span> Lockable{\r\n    <span><span><span><span>// redis缓存key</span></span></span></span>\r\n    String key();\r\n    <span><span><span><span>// redis缓存key中的数据</span></span></span></span>\r\n    String value() default \"\";\r\n    <span><span><span><span>// 过期时间(秒)，默认为一分钟</span></span></span></span>\r\n    long expire() default 60;\r\n}\r\n</code></pre><p>定时任务增加注解@Lockable：</p><pre><code> <span><span><span><span>@Lockable</span></span></span></span>(key = <span><span><span><span>\"DistributedLock:dealExpireRecords\"</span></span></span></span>)\r\n <span><span><span><span><span><span><span><span>public</span></span></span></span></span></span></span><span><span><span> </span></span></span><span><span><span><span><span><span><span>void</span></span></span></span></span></span></span><span><span><span> </span></span></span><span><span><span><span><span><span><span>dealExpireRecords</span></span></span></span></span></span></span><span><span><span><span><span><span><span>()</span></span></span></span></span></span></span><span><span><span> </span></span></span></span>{\r\n }\r\n</code></pre><p>定义一个aop切面LockAspect，使用@Around处理所有注解为@Lockable的方法，通过连接点确认此注解是用在方法上，通过方法获取注解信息，使用setIfAbsent来判断是否获取分布式锁，如果没有获取分布式锁，直接返回；如果获取到分布式锁，通过expire设置过期时间，并调用指定方法。</p><pre><code><span><span><span><span>@Component</span></span></span></span>\r\n<span><span><span><span>@Slf4j</span></span></span></span>\r\n<span><span><span><span>@Aspect</span></span></span></span>\r\n<span><span><span><span>public</span></span></span></span> <span><span><span><span><span><span><span><span>class</span></span></span></span></span></span></span><span><span><span> </span></span></span><span><span><span><span><span><span><span>LockAspect</span></span></span></span></span></span></span><span><span><span> </span></span></span></span>{\r\n\r\n    <span><span><span><span>@Autowired</span></span></span></span>\r\n    <span><span><span><span>private</span></span></span></span> RedisTemplate redisTemplate;\r\n\r\n    <span><span><span><span>@Around(</span></span></span><span><span><span><span><span><span><span>\"@annotation(com.records.aop.Lockable)\"</span></span></span></span></span></span></span><span><span><span>)</span></span></span></span>\r\n    <span><span><span><span>public</span></span></span></span> Object distributeLock(ProceedingJoinPoint pjp) {\r\n        Object resultObject = <span><span><span><span>null</span></span></span></span>;\r\n\r\n        <span><span><span><span>//确认此注解是用在方法上</span></span></span></span>\r\n        Signature signature = pjp.getSignature();\r\n        <span><span><span><span>if</span></span></span></span> (!(signature instanceof MethodSignature)) {\r\n            log.error(<span><span><span><span>\"Lockable is method annotation!\"</span></span></span></span>);\r\n            <span><span><span><span>return</span></span></span></span> resultObject;\r\n        }\r\n\r\n        MethodSignature methodSignature = (MethodSignature) signature;\r\n        Method targetMethod = methodSignature.getMethod();\r\n\r\n        <span><span><span><span>//获取注解信息</span></span></span></span>\r\n        Lockable lockable = targetMethod.getAnnotation(Lockable.<span><span><span><span>class</span></span></span></span>);\r\n        String key = lockable.key();\r\n        String value = lockable.value();\r\n        long expire = lockable.expire();\r\n\r\n        <span><span><span><span>// 分布式锁，如果没有此key，设置此值并返回true；如果有此key，则返回false</span></span></span></span>\r\n        boolean result = redisTemplate.boundValueOps(key).setIfAbsent(value);\r\n        <span><span><span><span>if</span></span></span></span> (!result) {\r\n            <span><span><span><span>//其他程序已经获取分布式锁</span></span></span></span>\r\n            <span><span><span><span>return</span></span></span></span> resultObject;\r\n        }\r\n\r\n        <span><span><span><span>//设置过期时间，默认一分钟</span></span></span></span>\r\n        redisTemplate.boundValueOps(key).expire(expire, TimeUnit.SECONDS);\r\n\r\n        <span><span><span><span>try</span></span></span></span> {\r\n            resultObject = pjp.proceed(); <span><span><span><span>//调用对应方法执行</span></span></span></span>\r\n        } <span><span><span><span>catch</span></span></span></span> (Throwable throwable) {\r\n            throwable.printStackTrace();\r\n        }\r\n        <span><span><span><span>return</span></span></span></span> resultObject;\r\n    }\r\n}\r\n</code></pre><h2>4.使用redis的getset()来实现分布式锁</h2><p>此方法使redisTemplate.boundValueOps(key).getAndSet(value)的方法，如果返回空，表示获取了分布式锁；如果返回不为空，表示分布式锁已经被其他程序占用</p><h2>5.使用zookeeper的创建节点node</h2><p>使用zookeeper创建节点node，如果创建节点成功，表示获取了此分布式锁；如果创建节点失败，表示此分布式锁已经被其他程序占用(多个程序同时创建一个节点node，只有一个能够创建成功)</p><h2>6.使用zookeeper的创建临时序列节点</h2><p>使用zookeeper创建临时序列节点来实现分布式锁，适用于顺序执行的程序，大体思路就是创建临时序列节点，找出最小的序列节点，获取分布式锁，程序执行完成之后此序列节点消失，通过watch来监控节点的变化，从剩下的节点的找到最小的序列节点，获取分布式锁，执行相应处理，依次类推......</p><p>本文主要介绍了使用redis和zookeeper实现分布式锁的处理，也可以关注我的公众号：不知风在何处，相互沟通，共同进步。</p><p><br></p>'),(183,'&nbsp;&nbsp;&nbsp; 123123123123123132<br><p><br></p>'),(184,'&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; 12313213213213<br><p><br></p>');

